import { createSlice } from "@reduxjs/toolkit";

const initialState = [
  {
    images: [],
    ids: [],
  },
];

const likesSlice = createSlice({
  name: "likes",
  initialState,
  reducers: {},
});

export default likesSlice.reducer;
